import React from 'react';
import styled from "styled-components"
import { BrowserRouter as Router, Switch, Route } from "react-router-dom"
import { CPage, CLogo } from "@appcues/component-library";

import FlowList from "./flow-list.svg";
import './App.css';

const Logo = styled(CLogo)`
  max-height: 100%;
  height: 100%;
  margin: 0 auto;
  width: 200px;
`;

function App() {
  return (
    <Router>
    <Logo/>
    Welcome to Appcues
    <Switch>
    <Route path="/analytics">
    </Route>
    <Route path="/">
    <CPage>
    <img src={FlowList}/>
    </CPage>
    </Route>
    </Switch>
    </Router>
  );
}

export default App;
